import React from 'react';
import './HomePage.css';

import backgroundImage from './image/home.png';

const HomePage = () => {
  return (
    <div
      className="full-image-container"
      style={{
        backgroundImage: `url(${backgroundImage})`,
      }}
    ></div>
  );
};

export default HomePage;
